import React, { Component } from "react";
import logo from "./logo.svg";
import "./App.css";
import fire from "./Fire";
class App extends Component {
  render() {
    fire
      .database()
      .ref()
      .child("A")
      .set("AA");
    return <div className="App" />;
  }
}

export default App;
